import React from 'react';
import PageContainer from 'hoc/PageContainer';
import PageNotFound from 'components/PageNotFound';

const Page404 = () => {

    return (
        <PageContainer>
            <PageNotFound />
        </PageContainer>
    )
}

export default Page404;
